public MultiSearcherThread(
	Searchable searchable,
	Query query,
	Filter filter,
	int nDocs,
	HitQueue hq,
	int i,
	int[] starts,
	String name) {
	super(name);
	this.searchable = searchable;
	this.query = query;
	this.filter = filter;
	this.nDocs = nDocs;
	this.hq = hq;
	this.i = i;
	this.starts = starts;
}

